import React from 'react' 

class NoIncluye extends React.Component {
    render (){
        return(
            <div className="container-noincluye">

                {
                    this.props.datos.Princess.noIncluye.map(
                        (noIncluido) => {
                            return(
                                <div>
                                    <h3>No incluye</h3>
                                    <div>
                                        <i className="material-icons col s12 l2 red-text center-align">announcement</i>
                                    </div>
                                    <div>
                                        <p>
                                            {noIncluido.titulo}
                                        </p>
                                    </div>
                                </div>

                            )
                        }
                    )
                }
               
	        </div>
        )
    }
}

export default NoIncluye
